import React, { useState, useEffect } from 'react'
import './Exercises.css'
// import Button from '@material-ui/core/Button';


function ShowExercises() {
  console.log("OUTPUT IN TOP")
  const [query, serQuery] = useState('');

  useEffect(() => {
    async function fetchData() {
      try {
        const getExercises = await fetch(
          'http://localhost:8080/api/v1/exercise',
          {
            method: 'GET',
            headers: {
              'Content-Type': 'application/json',
              'Access-Control-Allow-Origin': '*',
              'Cors-Allow-Origin': '*'
            }
          });
        const json = await getExercises.json();
        console.log("START")
        console.log({json});
        console.log("END")

      } catch (error) {}
    }

    if (query === '') {
      fetchData();
    }

  }, [query]);

  return (
    <div className='exercises'>
      <h1>Here you can see all exercises you did in the past</h1>
    </div>
  )
}

export default ShowExercises
